import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <ul>
        <li>
          <img src="hotdog.jpg" alt="not found"></img>
        </li>
        <li>
          <img src="hotdog2.jpg"></img>
        </li>
        <li>
          <img src="food.jpeg" alt="not found"></img>
        </li>
        <li>
          <img src="pizza.jpg" alt="not found"></img>
        </li>
      </ul>
    </div>
  );
}

export default App;
